import "./coffeList.scss";
import Coffe1 from "../img/coffe-1.png";


const CoffeList = ({index},props) =>{

    function clica(){

        alert("clicou");

    }
    return(

       <ul className="coffe-list">

            <li onClick={(e)=>{index++; clica()}}><img src={Coffe1}/></li>
            <li onClick={(e)=>{index++; clica()}}><img src={Coffe1}/></li>
            <li onClick={(e)=>{index++; clica()}}><img src={Coffe1}/></li>

       </ul>


    )

}

export default CoffeList;
